@GuitarMoog #WithdrawalAgreement will be the defining moment in T/L of #Brexit.   

#PeoplesVote,  #RevokeArticle50, even #TransitionPeriod, are all irrelevant #RedHerrings  

No #WithdrawalAgreement and we are staring at devastating reality of #NoDealBrexit of #HardBorder b/w Ni &amp; RoI.

